    "central-arkansas-national-wildlife-refuge-complex-comprehensive-conservation-plan",nt"isopen":
    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Central Arkansas NWR Complex for the next 15
    years. This plan outlines the Complex vision and purpose and describes how Central
    Arkansas NWR Complex will contribute to the overall mission of the Refuge System.
    The plan provides an introduction to the Complex, an overview of the CCP process,
    and information about the management direction and plan implementation. Key planning
    issues include: water quality, water flow management, land acquisition, habitat
    management, hunting, camping, access, wildlife observation/photography, law enforcement,
